package com.EsportLeagueStats.ESLS.web.requests;public class AddTimRequest {    private String t_ime;    private String t_logo;    private int lid;    public AddTimRequest(){}    public AddTimRequest(String t_ime, String t_logo, int lid) {        this.t_ime = t_ime;        this.t_logo = t_logo;        this.lid = lid;    }    public String getT_ime() {        return t_ime;    }    public void setT_ime(String t_ime) {        this.t_ime = t_ime;    }    public String getT_logo() {        return t_logo;    }    public void setT_logo(String t_logo) {        this.t_logo = t_logo;    }    public int getLid() {        return lid;    }    public void setLid(int lid) {        this.lid = lid;    }}